import * as React from "react";
import css from "./Location.module.scss";

export const Location: React.FC<{ street: string; city: string }> = ({
  street,
  city,
}) => {
  if (!street && !city) return null;
  return (
    <p className={css.location}>
      {street}
      <br />
      {city}
    </p>
  );
};
